import React from "react";
import { useState } from "react";
import "../Register.css";

const FileSeach = ({ dealToSearch, actualUser }) => {
  const [price, setPrice] = useState(0);
  const [cc, setCc] = useState(0);
  const [fuel, setFuel] = useState("");
  const [hp, setHp] = useState(0);
  const [year1, setYear] = useState(0);
  const [year2, setYear2] = useState(0);

  const handleOnSubmit = (e) => {
    e.preventDefault();
    if (true) {
      dealToSearch({ price, cc, year1, hp, fuel });
    }
  };

  return (
    <div
      className="Appp"
      style={{
        position: "absolute",
        left: "50%",
        top: "50.5%",
        transform: "translate(-50%, -50%)",
      }}
    >
      <h2>Enter the searching criterias:</h2>
      <form className="formm" onSubmit={handleOnSubmit}>
        <div className="input-grouppp">
          <label id="price"> price</label>
          <input
            type="text"
            value={price}
            placeholder="Enter the price"
            onChange={(e) => setPrice(e.target.value)}
          />
        </div>
        <div className="input-grouppp">
          <label> CC </label>
          <input
            type="text"
            value={cc}
            placeholder="Enter engine capacity"
            onChange={(e) => setCc(e.target.value)}
          />
        </div>
        <div className="input-grouppp">
          <label>Fuel</label>
          <input
            type="text"
            value={fuel}
            placeholder="Enter fuel : GPL/BENZINA/DIESEL"
            onChange={(e) => setFuel(e.target.value)}
          />
        </div>
        <div className="input-grouppp">
          <label> HP </label>
          <input
            type="text"
            value={hp}
            placeholder="Enter hourse power"
            onChange={(e) => setHp(e.target.value)}
          />
        </div>

        <div className="input-grouppp">
          <label>Starting Year</label>
          <input
            type="text"
            value={year1}
            placeholder="Enter the starting year"
            onChange={(e) => setYear(e.target.value)}
          />
          <label>Ending Year</label>
          <input
            type="text"
            value={year2}
            placeholder="Enter the ending year"
            onChange={(e) => setYear2(e.target.value)}
          />
        </div>
        <button className="buton ret det">Search</button>
      </form>
    </div>
  );
};
export default FileSeach;
